import { CheckIicon } from '@heroicons/react/24/solid';

function Item({ item }) {
  return (
    <li className='task'>
      <div className='task-group'>
        <input
          type='checkbox'
          checked={item.checked}
          name={item.name}
          id={item.id}
          className='label'
        />
        <label htmlFor={item.id}>
          {item.name}
          <p className='checkmark'>
            <CheckIicon strokeWidth={2} width={24} height={24} />
          </p>
        </label>
      </div>
    </li>
  );
}

export default Item;
